function deleteItem(props) {
  console.log(props.id);

  let url = `http://localhost:3000/workouts/${ props.id }`;
  console.log(url);

  fetch(url, { method: 'DELETE' });
  window.location.reload(false);
}

function editItem(props) {
  console.log("edit");
}

function Exercise( props ) {  
  return (
    <>
      <tr>
        <td>{ props.id }</td>
        <td>{ props.name }</td>
        <td>{ props.type }</td>
        <td>{ props.timing }</td>
        <td>{ props.target} </td>
        <td><button onClick={ () => deleteItem(props) }>Delete</button></td>
        <td><button onClick={ () => editItem(props) }>Edit</button></td>
      </tr>
      <tr>
        <form action="http://localhost:3000/workouts" method="POST" target="dummyframe" >
            <input type="text" id="id" name="id" placeholder="Id" /> 
            &nbsp;&nbsp;
            <input type="text" id="name" name="name" placeholder="Name" />
            &nbsp;&nbsp;          
            <input type="text" id="type" name="type" placeholder="Type" />
            &nbsp;&nbsp;         
            <input type="text" id="timing" name="timing" placeholder="Timing" />
            &nbsp;&nbsp;
            <input type="text" id="target" name="target" placeholder="Target" />
            &nbsp;&nbsp;
            <br />
            <br />
            <input type="submit" placeholder="Submit" />
          </form> 
      </tr>
    </>
  );
}

export default Exercise;
